pragma solidity ^0.8.13;

import {RevokableOperatorFilterer} from "./RevokableOperatorFilterer.sol";
import {OperatorFilterer} from "./OperatorFilterer.sol";

/**
 * @title  RevokableDefaultOperatorFilterer
